import React from 'react';
import {ContentLayout} from "@shared/ui";
import {TaskTable} from "@widgets/task_table";
import Header from '@widgets/header';

export const PersonalPage = () => {
    return (
        <ContentLayout row noAnimation>
            <ContentLayout row center>
                <TaskTable />
            </ContentLayout>

            <Header />
        </ContentLayout>
    );
};
